webpackJsonp([94738884013295],{7516:function(e,t){e.exports={data:{post:{html:"<p>This week we threw some more hardware at blogg.de and the other websites hosted by nu2m. This time it seems to be sticking to the wall (like <a href=\"http://photomatt.net/2006/01/05/wpcom-performance/\">noodles</a> when they're done). 12 must be our lucky number:</p>\n<ul>\n<li>6 webservers</li>\n<li>3 database servers</li>\n<li>2 load balancers</li>\n<li>and a firewall in a pear tree</li>\n</ul>\n<p>The rack isn't full yet, but the switch and the power strips are now maxed out. </p>",fields:{title:"Sticky Hardware",date:"11 Jan 2006",url:"https://papascott.de/2006-01-11-sticky-hardware/"}}},pathContext:{slug:"/2006-01-11-sticky-hardware/",prev:{fields:{title:"SkyScout",date:"08 Jan 2006",slug:"/2006-01-08-skyscout/"}},next:{fields:{title:"Technical Translation",date:"11 Jan 2006",slug:"/2006-01-11-technical-translation/"}}}}}});
